import React from 'react';
import { Navbar, Nav, Button, OverlayTrigger, Popover, NavDropdown } from 'react-bootstrap';


const CustomNavbar = () => {
  // Define the content for the Expertise popover
  const expertisePopover = (
    <Popover id="expertise-popover">
      {/* Add your expertise content here */}
      <Popover.Title>Expertise</Popover.Title>
      <Popover.Content>
        {/* Add expertise details */}
        Lorem ipsum dolor sit amet, consectetur adipiscing elit.
      </Popover.Content>
    </Popover>
  );

  // Define the content for the Solutions popover
  const solutionsPopover = (
    <Popover id="solutions-popover">
      {/* Add your solutions content here */}
      <Popover.Title>Solutions</Popover.Title>
      <Popover.Content>
        {/* Add solutions details */}
        Lorem ipsum dolor sit amet, consectetur adipiscing elit.
      </Popover.Content>
    </Popover>
  );

  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand>
        <span className="font-weight-bold">EsaLink</span>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="https://www.google.com">Tma connection</Nav.Link>
        </Nav>
        <Button variant="primary">Get a Demo</Button>
        <OverlayTrigger
          trigger="hover"
          placement="bottom"
          overlay={expertisePopover}
        >
          <Nav.Link>Expertise</Nav.Link>
        </OverlayTrigger>
        <OverlayTrigger
          trigger="hover"
          placement="bottom"
          overlay={solutionsPopover}
        >
          <Nav.Link>Solutions</Nav.Link>
        </OverlayTrigger>
        <Nav.Item className="ml-auto">
          <NavDropdown title="Dropdown" id="nav-dropdown">
            {/* Add dropdown items here */}
            <NavDropdown.Item>Action</NavDropdown.Item>
            <NavDropdown.Item>Another action</NavDropdown.Item>
          </NavDropdown>
        </Nav.Item>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default CustomNavbar;
